          "# Dependent Fields in ArrayField\n\nInformed's hooks are automatically scoped for you!!\n\n<!-- STORY -->\n\n```jsx\nimport { Form, Input, ArrayField } from 'informed';\n\nconst options = {\n  car: [\n    {\n      value: '',\n      label: '- Select -',\n      disabled: true\n    },\n    {\n      value: 'modelS',\n      label: 'Model S'\n    },\n    {\n      value: 'model3',\n      label: 'Model 3'\n    },\n    {\n      value: 'modelX',\n      label: 'Model X'\n    },\n    {\n      value: 'modely',\n      label: 'Model Y'\n    }\n  ],\n  truck: [\n    {\n      value: '',\n      label: '- Select -',\n      disabled: true\n    },\n    {\n      value: 'semi',\n      label: 'Semi Truck'\n    },\n    {\n      value: 'cyber',\n      label: 'Cyber Truck'\n    }\n  ]\n};\n\nconst CarOrTruck = () => {\n  return (\n    <>\n      <label>Would you like a car or truck?</label>\n      <RadioGroup name=\"type\">\n        <Radio value=\"car\" label=\"Car\" />\n        <Radio value=\"truck\" label=\"Truck\" />\n      </RadioGroup>\n    </>\n  );\n};\n\nconst ProductSelect = () => {\n  const { value, dirty } = useFieldState('type');\n  const { clearValue } = useFieldApi('product');\n\n  const opts = useMemo(() => options[value] || [], [value]);\n\n  useEffect(\n    () => {\n      if (dirty) clearValue();\n    },\n    [value]\n  );\n\n  return (\n    <Select field=\"product\" label=\"Product\" disabled={!value}>\n      <option value=\"\" disabled>\n        - Select -\n      </option>\n      {opts.map(option => (\n        <option key={option.value} value={option.value}>\n          {option.label}\n        </option>\n      ))}\n    </Select>\n  );\n};\n\nconst initialValues = {\n  friends: [\n    {\n      name: 'Joe',\n      type: 'truck'\n    },\n    {\n      name: 'Jane',\n      type: 'car'\n    }\n  ]\n};\n\nconst DynamicArrays = () => {\n  return (\n    <Form initialValues={initialValues}>\n      <h5>You:</h5>\n      <Input name=\"name\" label=\"Your Name:\" />\n      <h5>Friends:</h5>\n      <ArrayField name=\"friends\">\n        {({ add }) => (\n          <>\n            <button type=\"button\" onClick={add}>\n              Add Sibling\n            </button>\n            <ArrayField.Items>\n              {({ remove, name, index }) => (\n                <>\n                  <h5>{name}</h5>\n                  <Input name=\"name\" label=\"Name\" required />\n                  <CarOrTruck />\n                  <ProductSelect />\n                  <button type=\"button\" onClick={remove}>\n                    Remove\n                  </button>\n                </>\n              )}\n            </ArrayField.Items>\n          </>\n        )}\n      </ArrayField>\n      <button type=\"submit\">Submit</button>\n    </Form>\n  );\n};\n```\n";

