          '# Huge Array form\n\n```jsx\nimport {\n  Form,\n  Input,\n  ArrayField,\n  useFieldState,\n  Relevant,\n  Debug\n} from \'informed\';\n\nconst friends = Array.from(Array(69)).map(e => {\n  return { name: \'Joe\', age: 26, f: \'foo\' };\n});\n\nconst initialValues = {\n  friends\n};\n\nconst FieldState = ({ name }) => {\n  const nameState = useFieldState(name);\n  return (\n    <>\n      <h5>Component using nameState: {name}</h5>\n      Render: {Math.random()}\n      <pre>\n        <code>{JSON.stringify(nameState, null, 2)}</code>\n      </pre>\n    </>\n  );\n};\n\nconst NestedForm = () => (\n  <div>\n    <Form\n      initialValues={initialValues}\n      onSubmit={({ values }) => console.log(values)}>\n      <div style={{ display: \'flex\', flexWrap: \'wrap\' }}>\n        <div style={{ flex: 1, marginRight: \'2rem\' }}>\n          <button type="submit">Submit</button>\n          <ArrayField name="friends">\n            {({ add, addWithInitialValue, reset }) => {\n              return (\n                <React.Fragment>\n                  <button\n                    onClick={() => {\n                      reset();\n                    }}\n                    type="button">\n                    Reset\n                  </button>\n                  <button\n                    onClick={() => {\n                      add();\n                    }}\n                    type="button">\n                    Add\n                  </button>\n\n                  <button\n                    onClick={() => {\n                      addWithInitialValue({ name: \'test\' });\n                    }}>\n                    Add with initialValue\n                  </button>\n\n                  <ArrayField.Items>\n                    {({ remove, name, reset, initialValue, setValue }) => (\n                      <label>\n                        <h5>{name}</h5>\n                        <FieldState name={name} />\n                        <Input\n                          name="name"\n                          initialValue={initialValue && initialValue.name}\n                        />\n                        <Input name="age" />\n                        <Input name="a" />\n                        <Input name="b" />\n                        <Input name="c" />\n                        <Input name="d" />\n                        <Input name="e" />\n                        <Input name="f" />\n                        {/* Example using scope  */}\n                        <Input\n                          name="g"\n                          relevanceWhen={scope => [`${scope}.f`]}\n                          relevant={({ formApi, scope }) =>\n                            formApi.getValue(`${scope}.f`)\n                          }\n                        />\n                        {/* Example using default ( scoped ) */}\n                        <Input\n                          name="h"\n                          relevanceWhen={[\'f\']}\n                          relevant={({ formApi }) =>\n                            formApi.getValue(`${name}.f`)\n                          }\n                        />\n                        <Relevant\n                          when={({ formApi }) => formApi.getValue(`${name}.f`)}>\n                          <Input name="i" />\n                          <Input name="j" />\n                          <Input name="k" />\n                          <Input name="l" />\n                          <Input name="m" />\n                        </Relevant>\n\n                        <button\n                          type="button"\n                          onClick={() => {\n                            reset();\n                          }}>\n                          Reset\n                        </button>\n                        <button\n                          type="button"\n                          onClick={() => setValue(\'name\', \'Elon\')}>\n                          Set Name to "Elon"\n                        </button>\n                        <button type="button" onClick={remove}>\n                          Remove\n                        </button>\n                      </label>\n                    )}\n                  </ArrayField.Items>\n                </React.Fragment>\n              );\n            }}\n          </ArrayField>\n        </div>\n        <div style={{ flex: 2, minWidth: \'300px\', marginLeft: \'3rem\' }}>\n          <Debug />\n        </div>\n      </div>\n    </Form>\n  </div>\n);\n```\n\n<!-- STORY -->\n';

