          "## So what if i do want to hook it all up myself?\n\n**Dont Fret!** Check out the example below:\n\n<!-- STORY -->\n\n<!-- IDFK Strange issue where i need this commnet or code formatting is messed up -->\n\n```jsx\nimport { Form, asField } from 'informed';\n\nconst validate = value => {\n  return !value || value.length < 5\n    ? 'Field must be at least five characters'\n    : undefined;\n};\n\nconst ErrorText = asField(({ fieldState, fieldApi, ...props }) => {\n  const { value, error, showError } = fieldState;\n  const { setValue, setTouched } = fieldApi;\n  const { onChange, onBlur, initialValue, forwardedRef, ...rest } = props;\n  return (\n    <React.Fragment>\n      <input\n        {...rest}\n        ref={forwardedRef}\n        value={!value && value !== 0 ? '' : value}\n        onChange={e => {\n          setValue(e.target.value);\n          if (onChange) {\n            onChange(e);\n          }\n        }}\n        onBlur={e => {\n          setTouched(true);\n          if (onBlur) {\n            onBlur(e);\n          }\n        }}\n        style={showError ? { border: 'solid 1px red' } : null}\n      />\n      {showError ? (\n        <small style={{ color: 'red' }}>{fieldState.error}</small>\n      ) : null}\n    </React.Fragment>\n  );\n});\n\n<Form id=\"custom-form\">\n  <label>\n    First name:\n    <ErrorText\n      field=\"name\"\n      validate={validate}\n      validateOnChange\n      validateOnBlur\n    />\n  </label>\n  <button type=\"submit\">Submit</button>\n</Form>;\n```\n";

